import React, { useState } from 'react';
import './Header.css';

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header>
      <nav className={`navbar ${isOpen ? 'open' : ''}`}>
        <div className="logo">
          <img src="images/logo/logo.png" className="logi" alt="PAWS VEDA Logo" />
        </div>
        <div className="add-icon">
          <p><b>P</b></p>
          <span style={{ fontSize: "20px" }}>&#128062;</span>
          <p><b>aws </b></p>
          <p><b>Veda</b></p>
        </div>
        <div className="nav-search">
          <img src="images/WhatsApp_Image_2024-05-16_at_12.14.57_AM.jpeg" style={{ height: "20px", margin: "0 20px" }} alt="WhatsApp" />
          <input placeholder="Search" className="search-input" />
          <img src="images/search.jpeg" style={{ height: "20px", margin: "5px 15px" }} alt="Search Icon" />
        </div>
        <div className="icon">
          <ul>
            <li><i className="fas fa-shopping-bag" aria-hidden="true"></i><span className="sr-only">Shopping Bag</span></li>
            <li><i className="fas fa-user-circle" aria-hidden="true"></i><span className="sr-only">User Profile</span></li>
          </ul>
        </div>
        <div className="hamburger" onClick={toggleMenu}>
          <i className={`fas ${isOpen ? 'fa-times' : 'fa-bars'}`} aria-hidden="true"></i>
        </div>
      </nav>
      <div className={`header1 ${isOpen ? 'open' : ''}`}>
        <a className="h" href="#home"><i className="fas fa-home"></i> Home</a>
        <a className="h" href="#shop"><i className="fas fa-store"></i> Shop</a>
        <a className="h" href="#PetCare"><i className="fas fa-paw"></i> Pet care</a>
        <a className="h" href="#pet-accessories"><i className="fas fa-paw"></i> Pet Accessories</a>
        <a className="h" href="#about"><i className="fas fa-info-circle"></i> About</a>
      </div>
    </header>
  );
};

export default Header;
